import React from "react";

const LogoDefault = () => {
  return (
    <svg width="40" height="40" viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg">
      <circle cx="20.9778" cy="24.4329" r="8.38148" transform="rotate(-180 20.9778 24.4329)" stroke="#070707" strokeWidth="1.5" />
      <circle cx="13.5738" cy="15.5482" r="8.38148" transform="rotate(-180 13.5738 15.5482)" stroke="#070707" strokeWidth="1.5" />
      <circle cx="26.4072" cy="15.5482" r="8.38148" transform="rotate(-180 26.4072 15.5482)" stroke="#070707" strokeWidth="1.5" />
    </svg>
  );
};

export default LogoDefault;
